this.parameters.vidIntervals = this.state.thisInterval ;

//set cue and threat types 
cueTypes = new Array ('T','T','T','T','T','T','T','T','T','T','T',
 'S','S','S','S','S','S','S','S') // 11 T, 8 S
// 3 Threat-Shock(SH), 8 Threat-NoShock(TH)
//threatTypes = new Array('SH','SH','SH','TH','TH','TH','TH','TH','TH','TH','TH');
threatTypes = new Array('SH','SH','SH','SH','SH','SH','SH','SH','TH','TH','TH');
waterfall = new Array('W1','W2'); // Waterfall video 1,2
//waterfall=new Array('W1');
nails = new Array('N2','N3'); // Nails video 2,3
//nails = new Array('W1');

//waterfall = new Array('http://brainimaging.waisman.wisc.edu/~nacewicz/Movies/Waterfall1.mp4','http://brainimaging.waisman.wisc.edu/~nacewicz/Movies/Waterfall2.mp4');
//nails = new Array('http://brainimaging.waisman.wisc.edu/~nacewicz/Movies/NailsOnChalkboard_Clip2.mp4','http://brainimaging.waisman.wisc.edu/~nacewicz/Movies/NailsOnChalkboard_Clip2.mp4');

